import React from 'react';
import { useHistory } from 'react-router';

function Header() {
  const history = useHistory();

  return (
    <section>
      <button
        type="button"
        data-testids="profile-top-btn"
        onClick={ () => history.push('/perfil') }
      >
        <img src="../images/profileIcon.svg" alt="profile icon" />
      </button>

      <p data-testids="search-top-btn">Comidas</p>

      <button
        type="button"
        data-testids="search-top-btn"
        onClick={ () => history.push('/perfil') }
        onDoubleClick={ () => history.push('/perfil') }
      >
        <img src="../images/searchIcon.svg" alt="search icon" />
      </button>
    </section>
  );
}

export default Header;
